import { GET_QUESTIONS } from "../actionTypes";

const initialQuestions = [
  {
      question: "Where are the three smallest bones in the human body?",
      choiceA: "middle ear",
      choiceB: "nose",
      choiceC: "toes",
      choiceD: "eyes",
      correct: "A"
  },
  {
      question: "What is the most abundant element in the Universe?",
      choiceA: "Helium",
      choiceB: "Oxygen",
      choiceC: "Lithium",
      choiceD: "Hydrogen",
      correct: "D"
  },
  {
      question: "Approximately how long does it take for light to travel from the Sun's surface to the Earth?",
      choiceA: "8 days",
      choiceB: "8 seconds",
      choiceC: "8 minutes",
      choiceD: "8 hours",
      correct: "C"
  },
  {
      question: "What is 10/2?",
      choiceA: "5",
      choiceB: "2",
      choiceC: "8",
      choiceD: "9",
      correct: "A"
  },
  {
      question: "Which planet has the most moons?",
      choiceA: "Saturn",
      choiceB: "Mars",
      choiceC: "Jupiter",
      choiceD: "Uranus",
      correct: "C"
  }
];

export const questionReducer = (state = initialQuestions, action) => {
  switch(action.type) {
    case GET_QUESTIONS:
      return action.payload;
    default:
      return state;
  }
}
